<a name="details" id="details"></a><h2 class="groupheader">Detailed Description</h2>
<div class="textblock"><p>This class wraps an HTTP response, which is basically : </p>
<ul>
<li>a header with a status code and a set of field/value pairs</li>
<li>a body (the content of the requested resource) </li>
</ul>

<p>Definition at line <a class="el" href="Http_8hpp_source.php#l00168">168</a> of file <a class="el" href="Http_8hpp_source.php">Http.hpp</a>.</p>
